  false,\n\t\"url\": null,\n\t\"notes\": \"The USGS Imagery Topo Large service from
  The National Map (TNM) is a dynamic topographic base map service that combines the
  best available data (Boundaries, Elevation, Geographic Names, Hydrography, Land
  Cover, Structures, and Transportation with Orthoimagery) that make up The National
  Map. Contours generated for the US Topo product are visible along with other data
  at scales of 1:13,500 and larger. This product is designed to provide a seamless
  view of the data in a geographic information system (GIS) accessible format, closely
  resembling The National Map US Topo GeoPDF product at large scales.\",\n\t\"license_title\":
